import React from 'react';
import Town from './Town.js';
import Dashboard from './Dashboard.js'
import './Townslist.css'

const Townslist = ({ towns=[] }) => 
    <div className="d-flex justify-content-between">
        {towns.map(town =>
                    <Town key={town.id}
                    {...town} />
            )
        }
                <Dashboard />
    </div>

export default Townslist
